import React from "react";
import "./home.css";

const Home = () => {
  return (
    <div className="home-container">
      <div className="/images/background.jpg"></div> {/* Background Image Div */}
      <div className="content">
        <h1>Welcome to Task Management</h1>
        <p>Select your role:</p>
        <div className="button-group">
          <button className="admin-button" onClick={() => (window.location.href = "/admin-login")}>
            Admin
          </button>
          <button className="user-button" onClick={() => (window.location.href = "/user-login")}>
            User
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
